import React from 'react';
import { NavLink } from 'react-router-dom';
import CN from 'classnames';
import styled from 'styled-components';

export const Wrapper = ({ children }) => (
	<section className="w-80 center mv4 flex justify-between flex-wrap">
		{children}
	</section>
);

export const Main = ({ children }) => (
	<section className="w-80 center mv4">{children}</section>
);

export const Card = ({ back, title, subtitle, to, color }) => (
	<NavLink to={to} className="mb3  w-32 h7 relative">
		<div
			className={CN(
				'absolute hide- flex items-center justify-center futura ttu fw7 f1 z-max card-title whale',
				color
			)}
		>
			{title}
		</div>
		<div className="overflow-hidden whale z-0">
			<img src={back} alt="prj" className="obj-card" />
		</div>
	</NavLink>
);

export const DoubleCard = ({ back, title, to, color }) => (
	<NavLink to={to} className="mb3  w-64 h7 relative">
		<div
			className={CN(
				'absolute  flex items-center justify-center futura ttu fw7 f1 z-max card-title whale',
				color
			)}
		>
			{title}
		</div>
		<div className="overflow-hidden whale z-0">
			<img src={back} alt="prj" className="obj-card" />
		</div>
	</NavLink>
);

export const Bg = styled.div`
	background: ${(props) => `url(${props.background}) no-repeat top center`};
`;
